import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Wait for the search input using placeholder selector (different from previous attempts)
    await page.waitForSelector('input[placeholder="Search Amazon"]', { timeout: 5000 });

    // Focus and type a search term that should trigger autocomplete
    const searchInput = await page.$('input[placeholder="Search Amazon"]');
    await searchInput.click();
    await searchInput.type('iph', { delay: 100 });

    // Wait for the search suggestions dropdown to appear (using class selector)
    await page.waitForSelector('.search-suggestions', { timeout: 5000 });

    // Take screenshot of autocomplete suggestions
    const step2 = path.join(screenshotsDir, 'step_2_autocomplete.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Extract the suggestion items' text (using .suggestion-item class)
    const suggestions = await page.$$eval('.suggestion-item', els => els.map(e => e.textContent.trim()));

    // Click the first suggestion (using nth selector)
    const firstSuggestion = await page.$('.suggestion-item');
    if (firstSuggestion) {
      await firstSuggestion.click();
    }

    // Wait for the search results to load (look for heading with "Search Results" text)
    await page.waitForSelector('h2:has-text("Search Results")', { timeout: 5000 });

    // Take screenshot of the search results
    const step3 = path.join(screenshotsDir, 'step_3_results.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // Extract the number of results from the .results-count element
    let resultsCountText = '';
    try {
      resultsCountText = await page.$eval('.results-count', el => el.textContent.trim());
    } catch (e) {
      resultsCountText = '';
    }

    // Extract the titles of the first 3 products in results (using .product-title)
    const productTitles = await page.$$eval('.product-title', els =>
      els.slice(0, 3).map(e => e.textContent.trim())
    );

    return {
      success: true,
      action: "Tested search autocomplete: triggered suggestions, selected a suggestion, verified search results.",
      extractedData: {
        suggestions,
        resultsCountText,
        productTitles
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
